import React from "react";
import { Unity, useUnityContext } from "react-unity-webgl";
function ActualGame() {
  const { unityProvider } = useUnityContext({
    loaderUrl: "./FinalBuild/Build/Build.js",
    dataUrl: "./FinalBuild/Build/build.data",
    frameworkUrl: "./FinalBuild/Build/build.framework.js",
    codeUrl: "./FinalBuild/Build/build.wasm",
  });
  return (
    
    <div>
      <h1>
        your mom
      </h1>
      <Unity unityProvider={unityProvider} style={{ height: 600, width: 800 }} />
    </div>
  );
}
export default ActualGame;
